import React, { useState, useEffect } from "react";
import Login from './pages/Login.js'
import Register from './pages/Register.js'
import Console from "./pages/Console.js";
import Navbar from './pages/Navbar.js'
import Profile from './pages/Profile.js'
import AuthContext from "./context/AuthContext.js";
import { Route, Redirect, Routes } from 'react-router-dom';
import Cookies from "js-cookie";
import PrivateRoute from "./PrivateRoute/index.js";

const App = () => {
  const [currentForm, setCurrentForm] = useState('login');
  const [isAuthenticated, setIsAuthenticated] = useState(!!Cookies.get('token'));

  const toggleForm = (formName) => {
    setCurrentForm(formName);
  }

  return (
    <div className="App">
      <div>
        <Navbar/>
      </div>
      <div className="App-contents">
        <Routes>
          <Route path="/login" element={<Login/>}/>
          <Route path="/register" element={<Register/>}/>
          <Route path="/console" element={isAuthenticated? <PrivateRoute><Console/></PrivateRoute> : <Redirect to="/login" />} />
          <Route path="/console" element={isAuthenticated? <PrivateRoute><Profile/></PrivateRoute> : <Redirect to="/login" />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
